This week, we secured more than $7 million to fund community projects in California’s 28th District. These projects will deliver lifesaving health services, emergency housing, support for small businesses, and public safety investments — that will enhance the quality of life for all. I’m thrilled they have been be included in the recently introduced government funding bills, and I look forward to celebrating their passage soon.

